$(document).ready(function(){$(function(){$("a[href*=#]:not([href=#])").click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var t=$(this.hash);if(t=t.length?t:$("[name="+this.hash.slice(1)+"]"),t.length)return $("html,body").animate({scrollTop:t.offset().top-24},1e3),!1}})}),$("#content h2, #content h3").addClass("toc_heading"),$(".toc_heading").each(function(t){var n=$(this);n.attr("id","title"+t),$("#table-of-content").append("\n        <li><a id='link"+t+"' href='#title"+t+"' class='link-"+n.get(0).tagName+"'>"+n.html()+"</a></li>\n        ")})});